import React from 'react';
import { useSelector } from 'react-redux';
import './orderedProducts.css'
import HeaderOfPage from '../Header/HeaderOfPage';

const OrderedProductsBody = () => {
    const store = useSelector(state => state.productsSlice)
    return (
        <div className="orderedProductsBody">
            <HeaderOfPage 
                sum={store.sumOfPricesAddedProducts} 
                count={store.amountAddedProducts} 
            />
            <div className="orderedProductsTable">
                <table className="orderedProductsTableTitle">
                    <thead>
                        <tr>
                            <th>Date</th>
                            <th>Name</th>
                            <th>Origin</th>
                            <th>Amount</th>
                            <th>Price</th>
                        </tr>
                    </thead>
                </table>
            </div>
        </div>
    )
}

export default OrderedProductsBody
